function Miles({flipped, onChange, amount}) {
    return (
      <div>
        <label htmlFor="miles">Miles</label>
        <input 
          value={flipped ? amount*.621 : amount}
          id="miles" 
          placeholder="Miles"
          type="number" 
          onChange={onChange}
          disabled={flipped === true}
        />
      </div>
    )
}
export default Miles;
